import React, {useState,useEffect} from 'react'

export const Results = () => {
    const [data,setData] = useState([{}])

    useEffect (() => {
        fetch('/').then(
        res => res.json()

    ).then(
        data => {
            setData(data)
            console.log(data)

        }
    )
}, [])

  return (
    <div>Results</div>
  )
}
